import "./App.css";

function App() {
  return (
    <>
      <div className="signIn h-screen grid place-items-center ">

        <div className=" px-8  border grid place-items-center ">

          <img className="max-w-52 " src={require("./insta.png")} />

          <form className="flex flex-col gap-1 py-5  text-xs w-60">
            <label htmlFor="username"></label>
            <input className="border px-2 py-3 rounded" placeholder="Phone number, username, or email" type="text" />
            <label htmlFor="username"></label>
            <input className="border px-2 py-3 rounded" placeholder="Password" type="password" />
          </form>

          <button className="w-full text-white bg-sky-500 rounded-md py-1 font-semibold">Sign In</button>
        </div>



      </div>
    </>
  );
}

export default App;
